import React from 'react';

function Horses(props){

    return(
        <div>
           <div className="mx-auto">
             <div className="">
                 <img src={props.image} alt="Lights"  height="300" width="300"/>
                 <div className="caption">
                    <p>{props.name}</p>
                 </div>
            </div>
        </div> 
        </div>
    )
}

export default Horses;
